import React, { useState, useContext } from 'react';
import LoginScreen from './src/containers/LoginScreen';
import HomeScreen from './src/containers/HomeScreen';
import RoommateViewPostScreen from './src/containers/RoommateViewPostScreen';
import RoomViewPostScreen from './src/containers/RoomViewPostScreen';
import FavouriteScreen from './src/containers/FavouriteScreen';
import ProfileScreen from './src/containers/ProfileScreen';
import Ionicons from 'react-native-vector-icons/Ionicons';
import { NavigationContainer } from '@react-navigation/native';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import { createStackNavigator } from '@react-navigation/stack';
import { UserInfoContextProvider } from './src/context/userInfoContext';
import { UserInfoContext } from './src/context/userInfoContext';
import Index from './Index';

const Stack = createStackNavigator();
const Tab = createBottomTabNavigator();

function LoginStack() {
  return(
    <Stack.Screen  
      name="LoginScreen" 
      component={LoginScreen} 
      options={{headerShown: false}}/>
  )
}

function HomeStack() {
  return (
      <Stack.Navigator >


        <Stack.Screen  
          name="HomeScreen" 
          component={HomeScreen} 
          options={{headerShown: false}}/>

        <Stack.Screen  
          name="RoommateViewPostScreen" 
          component={RoommateViewPostScreen} 
          options={{title: 'Find Roommate',
                    headerTitleAlign: 'center',
                    headerStyle: {
                      backgroundColor: '#D6B598',
                    },
                    headerTintColor: '#000000',
                    headerTitleStyle: {
                      fontSize: '24px',
                      fontWeight: 'bold',
                    },
                    }}/>

        <Stack.Screen  
        name="RoomViewPostScreen" 
        component={RoomViewPostScreen} 
        options={{title: 'Find Room',
                  headerTitleAlign: 'center',
                  headerStyle: {
                    backgroundColor: '#D6B598',
                  },
                  headerTintColor: '#000000',
                  headerTitleStyle: {
                    fontSize: '24px',
                    fontWeight: 'bold',
                  },
                  }}/>

      </Stack.Navigator>

  );
}
function FavouriteStack() {
  return (
      <Stack.Navigator >
        <Stack.Screen  
        name="FavouriteScreen" 
        component={FavouriteScreen} 
        options={{title: 'Favourite', 
                  headerTitleAlign: 'center',
                  headerStyle: {
                    backgroundColor: '#D6B598',
                  },
                  headerTintColor: '#000000',
                  headerTitleStyle: {
                    fontSize: '24px',
                    fontWeight: 'bold',
                  }, 
                  }}/>
      </Stack.Navigator>

  );
}
function ProfileStack() {
  return (
      <Stack.Navigator >
        <Stack.Screen  
        name="ProfileScreen" 
        component={ProfileScreen} 
        options={{title: 'Profile', 
                  headerTitleAlign: 'center',
                  headerStyle: {
                    backgroundColor: '#D6B598',
                  },
                  headerTintColor: '#000000',
                  headerTitleStyle: {
                    fontSize: '24px',
                    fontWeight: 'bold',
                  }, 
                  }}/>
      </Stack.Navigator>

  );
}

export default function App() {

  return (
    <Index/>
  );
}
